import React from 'react';

const CoursePage = () => {
  const handleEnrollClick = () => {
    // Handle enrollment logic here
    alert('Enrolled!');
  };

  return (
    <div>
      <header style={{ backgroundColor: '#333', color: 'white', padding: '1em', textAlign: 'center' }}>
        <h1>Course Title</h1>
      </header>

      <main style={{ padding: '2em' }}>
        <video controls style={{ width: '100%', height: 'auto' }}>
          <source src="path/to/your/video.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>

        <div style={{ marginTop: '1em' }}>
          <h2>Course Description</h2>
          <p>Your course description goes here.</p>
        </div>

        <div style={{ marginTop: '1em' }}>
          <h2>Instructor Details</h2>
          <p><strong>Instructor:</strong> John Doe</p>
          <p><strong>Experience:</strong> 5 years</p>
        </div>

        <button onClick={handleEnrollClick} style={{ backgroundColor: '#4caf50', color: 'white', padding: '0.5em 1em', border: 'none', cursor: 'pointer', marginTop: '1em' }}>
          Enroll Now
        </button>
      </main>
    </div>
  );
};

export default CoursePage;
